import React from "react";
import {NavLink} from 'react-router-dom'
const Nav = () => {
  return (
    <>
     <div>
     <NavLink exact activeClassName="active_class" to="/home">
     Home
</NavLink>
     <NavLink exact activeClassName="active_class" to="/about">
          About Us
        </NavLink>
        
     </div>
    </>
  );
};

export default Nav;
